import React, { useCallback, useContext, useEffect, useRef, useState } from 'react';
import PropTypes from "prop-types";
import { htmlIdGenerator } from '../../services/accessibility';
import classnames from 'classnames';
import { keys } from '../../services';
import { EuiDataGridColumnResizer } from './data_grid_column_resizer';
import { EuiPopover } from '../popover';
import { EuiListGroup } from '../list_group';
import { EuiScreenReaderOnly } from '../accessibility';
import tabbable from 'tabbable';
import { getColumnActions } from './column_actions';
import { useEuiI18n } from '../i18n';
import { EuiIcon } from '../icon';
import { DataGridFocusContext, DataGridSortingContext } from './data_grid_context';
export var EuiDataGridHeaderCell = props => {
  const {
    column,
    index,
    columns,
    columnWidths,
    schema,
    schemaDetectors,
    defaultColumnWidth,
    setColumnWidth,
    setVisibleColumns,
    switchColumnPos,
    headerIsInteractive,
    className
  } = props;
  const {
    id,
    display,
    displayAsText
  } = column;
  const width = columnWidths[id] || defaultColumnWidth;
  const ariaProps = {};
  const screenReaderId = htmlIdGenerator()();
  let sortString;
  const actionButtonAriaLabel = useEuiI18n('euiDataGridHeaderCell.headerActions', 'Header actions');
  const sorting = useContext(DataGridSortingContext);
  const {
    setFocusedCell,
    onFocusUpdate
  } = useContext(DataGridFocusContext);

  if (sorting) {
    const sortedColumnIds = new Set(sorting.columns.map(({
      id
    }) => id));

    if (sorting.columns.length === 1 && sortedColumnIds.has(id)) {
      const sortDirection = sorting.columns[0].direction;
      let sortValue = 'other';

      if (sortDirection === 'asc') {
        sortValue = 'ascending';
      } else if (sortDirection === 'desc') {
        sortValue = 'descending';
      }

      ariaProps['aria-sort'] = sortValue;
    } else if (sorting.columns.length >= 2 && sortedColumnIds.has(id)) {
      sortString = sorting.columns.map(col => `Sorted by ${col.id} ${col.direction}`).join(' then ');
      ariaProps['aria-describedby'] = screenReaderId;
    }
