  const sortingArrow = sortedColumn ? <EuiIcon type={sortedColumn.direction === 'asc' ? 'sortUp' : 'sortDown'} color="text" className="euiDataGridHeaderCell__sortingArrow" data-test-subj={`dataGridHeaderCellSortingIcon-${id}`} /> : null;
  return <div role="columnheader" {...ariaProps} ref={headerRef} tabIndex={isFocused && !isCellEntered ? 0 : -1} className={classes} data-test-subj={`dataGridHeaderCell-${id}`} style={width != null ? {
    width: `${width}px`
  } : {}}>
      {column.isResizable !== false && width != null ? <EuiDataGridColumnResizer columnId={id} columnWidth={width} setColumnWidth={setColumnWidth} /> : null}

      {sorting && sorting.columns.length >= 2 && <EuiScreenReaderOnly>
          <div id={screenReaderId}>{sortString}</div>
        </EuiScreenReaderOnly>}
      {!showColumnActions ? <>
          {sortingArrow}
          <div className="euiDataGridHeaderCell__content">
            {display || displayAsText || id}
          </div>
        </> : <EuiPopover anchorClassName="euiDataGridHeaderCell__anchor" panelPaddingSize="none" offset={7} button={<button className="euiDataGridHeaderCell__button" onClick={() => setIsPopoverOpen(isPopoverOpen => !isPopoverOpen)}>
              {sortingArrow}
              <div className="euiDataGridHeaderCell__content">
                {display || displayAsText || id}
              </div>
              <EuiIcon className="euiDataGridHeaderCell__icon" type="arrowDown" size="s" color="text" aria-label={actionButtonAriaLabel} data-test-subj={`dataGridHeaderCellActionButton-${id}`} />
            </button>} isOpen={isPopoverOpen} closePopover={() => setIsPopoverOpen(false)}>
          <div>
            <EuiListGroup listItems={columnActions} gutterSize="none" data-test-subj={`dataGridHeaderCellActionGroup-${id}`} />
          </div>
        </EuiPopover>}
    </div>;
};
